import "./App.css";
import Navbar from "./components/Navbar";
import Row from "./components/Row";
import Table from "./components/Table";
import Master from "./components/Master";
import DropdownButton from "react-bootstrap/DropdownButton";
import Dropdown from "@restart/ui/esm/Dropdown";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";

function App() {
  const [rows, setRows] = useState([
    {
      id: 0,
      firstName: "Albert",
      lastName: "Qi",
      email: "albertqiisthebest@college.harvard.edu",
      phoneNumber: "111-111-1111",
      houseYard: "Maple Yard",
      suite: "Inn 999",
      classYear: "First-Year",
      homeCity: "Needham",
      homeState: "MA",
      contactStatus: "Contacted",
      pteStatus: "PTE",
      registrationStatus: "Registered",
      stageOfVotingProcess: "Done",
      whereRegistered: "MA",
    },
    {
      id: 1,
      firstName: "Prat",
      lastName: "Mallick",
      email: "a@a.com",
      phoneNumber: "111-111-1111",
      houseYard: "Maple Yard",
      suite: "Inn #",
      classYear: "First-Year",
      homeCity: "Needham",
      homeState: "MA",
      contactStatus: "Contacted",
      pteStatus: "PTE",
      registrationStatus: "Registered",
      stageOfVotingProcess: "Done",
      whereRegistered: "MA",
    },
  ]);

  const updateRows = (query) => {
    setRows((rows) => [...rows, query]);
  };

  const header = [
    "First Name",
    "Last Name",
    "Email",
    "Phone Number",
    "House/Yard",
    "Suite",
    "Class Year",
    "Home City",
    "Home State",
    "Contact Status",
    "PTE Status",
    "Registration Status",
    "Stage of Voting Process",
    "Where Registered",
    "Actions",
  ];

  // Edit Row
  const editRow = (id) => {
    console.log("edit", id);
  };

  // Delete Row
  const deleteRow = (id) => {
    setRows(rows.filter((row) => row.id !== id));
  };

  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          {/* <Route path="/sign-up" component={SignUp} /> */}
          <Route path="/" exact />
        </Routes>
      </Router>
      {rows.length > 0 ? (
        <Table
          tableHeader={header}
          rows={rows}
          onEdit={editRow}
          onDelete={deleteRow}
        />
      ) : (
        "No rows"
      )}
    </>
  );
}

export default App;
